'use client';

import React, { useState } from 'react';
import {
  Box,
  Typography,
  TextField,
  Button,
  Paper,
  MenuItem,
  InputAdornment
} from '@mui/material';
import PersonIcon from '@mui/icons-material/Person';
import EmailIcon from '@mui/icons-material/Email';
import MessageIcon from '@mui/icons-material/Message';
import MiscellaneousServicesIcon from '@mui/icons-material/MiscellaneousServices';

const tiposServicio = [
  'Cotizaci√≥n agr√≠cola',
  'Consulta veterinaria',
  'Laboratorio t√©cnico',
  'Soporte rural',
  'Rastreo de pedido'
];

export default function FormularioServicio() {
  const [formData, setFormData] = useState({
    nombre: '',
    email: '',
    tipo: '',
    mensaje: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Solicitud enviada:', formData);
    alert('‚úÖ Solicitud enviada correctamente (modo local)');
  };

  return (
    <Box
      sx={{
        pt: 10,
        px: { xs: 2, md: 4 },
        pb: 6,
        background: 'linear-gradient(135deg, #e8f5e9 0%, #c8e6c9 100%)',
        minHeight: '100vh'
      }}
    >
      <Typography
        variant="h4"
        sx={{
          fontWeight: 'bold',
          textAlign: 'center',
          color: '#1b5e20',
          mb: 4
        }}
      >
        ‚úçÔ∏è Solicita tu Servicio en L√≠nea
      </Typography>

      <Paper
        elevation={4}
        sx={{
          p: 4,
          borderRadius: 4,
          maxWidth: 600,
          mx: 'auto',
          backgroundColor: 'white',
          boxShadow: '0 8px 20px rgba(0,0,0,0.1)'
        }}
      >
        <form onSubmit={handleSubmit}>
          <TextField
            label="Nombre completo"
            name="nombre"
            required
            fullWidth
            value={formData.nombre}
            onChange={handleChange}
            sx={{ mb: 3 }}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <PersonIcon color="action" />
                </InputAdornment>
              )
            }}
          />
          <TextField
            label="Correo electr√≥nico"
            name="email"
            type="email"
            required
            fullWidth
            value={formData.email}
            onChange={handleChange}
            sx={{ mb: 3 }}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <EmailIcon color="action" />
                </InputAdornment>
              )
            }}
          />
          <TextField
            label="Tipo de servicio"
            name="tipo"
            select
            required
            fullWidth
            value={formData.tipo}
            onChange={handleChange}
            sx={{ mb: 3 }}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <MiscellaneousServicesIcon color="action" />
                </InputAdornment>
              )
            }}
          >
            {tiposServicio.map((tipo, index) => (
              <MenuItem key={index} value={tipo}>
                {tipo}
              </MenuItem>
            ))}
          </TextField>
          <TextField
            label="Mensaje o detalle del servicio"
            name="mensaje"
            multiline
            rows={4}
            required
            fullWidth
            value={formData.mensaje}
            onChange={handleChange}
            sx={{ mb: 4 }}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <MessageIcon color="action" />
                </InputAdornment>
              )
            }}
          />
          <Button
            variant="contained"
            type="submit"
            fullWidth
            size="large"
            sx={{
              backgroundColor: '#2e7d32',
              fontWeight: 'bold',
              textTransform: 'none',
              '&:hover': {
                backgroundColor: '#1b5e20'
              }
            }}
          >
            üì§ Enviar solicitud
          </Button>
        </form>
      </Paper>
    </Box>
  );
}
